package data.Pinterest;

import utils.common.Common;
import utils.common.Constants;

public class Pin {

	private String pinName;
	private String note;
	private String link;
	private String image;
	private String imageUrl;
	private String imageBase64;
	private String boardName;

	public String getBoardName() {
		return boardName;
	}

	public void setBoardName(String boardName) {
		this.boardName = boardName;
	}

	public String getPinName() {
		return pinName;
	}

	public void setPinName(String pinName) {
		this.pinName = pinName;
	}

	public String getNote() {
		return note;
	}

	public void setNote(String note) {
		this.note = note;
	}

	public String getLink() {
		return link;
	}

	public void setLink(String link) {
		this.link = link;
	}

	public String getImage() {
		return image;
	}

	public void setImage(String image) {
		this.image = image;
	}

	public String getImageUrl() {
		return imageUrl;
	}

	public void setImageUrl(String imageUrl) {
		this.imageUrl = imageUrl;
	}

	public String getImageBase64() {
		return imageBase64;
	}

	public void setImageBase64(String imageBase64) {
		this.imageBase64 = imageBase64;
	}

	public Pin() {
		this.pinName = Common.getRandomString("Pin_");
		this.note = Common.getRandomString("Pin description ");
		this.image = Constants.DATA_FOLDER + "pins\\shiba.jpg";
		this.link = "http://google.com";
		this.imageUrl = "https://i.pinimg.com/originals/20/85/83/20858342e28793220caf868dd9ead578.jpg";
		this.imageBase64 = "data:image/jpeg;base64,";
	}

	public Pin(String pinName, String description, String link, String imgFile) {
		this.pinName = pinName;
		this.note = description;
		this.link = link;
		this.image = imgFile;
	}

}
